@-moz-document domain("www.latino-moviez.com") {
body {
    min-width: 0;
    background: black;
  	box-sizing: border-box;
}
.body-fauxcolumns, .content-fauxcolumns {display: none;}
.column-right-outer {display: none;}
.fauxcolumn-outer.fauxcolumn-center-outer {right: 0;}
.main-inner .columns {
    padding-right: 0;
    text-align: center;
}
center {display:none;}
marquee{display:none;}
header {display: none;}
.tabs-outer {display: none;}
footer {display: none;}
.content-outer, .content-fauxcolumn-outer, .region-inner {
min-width: 0;
max-width: none;
}
#blog-pager {display: none;}

.blog-feeds, .post-feeds {display: none;}
.main-inner {
    padding: 0;
}

body .navbar {
    display: none;
}

.body-fauxcolumns, .content-fauxcolumns {
    display: none;
}

.post-outer, .inline-ad {
    padding: 0;
}

.date-posts {
    padding: 0;
    margin: 0;
}

.date-outer {
    padding: 0;
    margin: 0;
}

.post-outer, .inline-ad {
    margin: 0;
    padding: 0;
}

.date-outer:last-child {
    margin: 0;
}

.post-footer {
    margin: 0;
}

.main-inner .section:last-child .Blog:last-child {
    margin: 0;
}

.main-inner .section {
    margin: 0;
}

.main-inner .column-center-inner, .main-inner .column-left-inner, .main-inner .column-right-inner {
    padding: 0;
}
}

@-moz-document domain("www.latino4ever.com"), domain("www.latinocanaleshd.com"), domain("latino-canales.blogspot.com") {
#navi1 li a {
  text-decoration: none;
  font-weight: normal !important;
  font-family: Open Sans;
  color: #A1A1A1 !important;
  padding: 6px;
  display: inline-block;
  width: 100px;
  border: 1px solid transparent;
  box-sizing: border-box;
}

#navi1 li{
  border: 0 !important;
  border-radius: 0 !important;
  background: transparent !important;
  margin: 0 !important;;
  padding: 0 !important;
  width: auto !important;
}
#navi1 li:hover{
  border: 0 !important;
  background:#666 !important;
  border-radius: 0 !important;
}
#navi1 li a:hover {
  font-style: normal !important;
  text-decoration: none;
}
}

